//import logo from './logo.svg';
import './App.css';
import React, {userstate} from 'react';

function App() {
  return (
    <div className='container'>
      <h1>Hello there, dead air.</h1>
      <p>Yesterday, I woke up sucking a lemon.</p>
      <ul>
        <li>
          <button>
            <span role="img" aria-label="" id="" src='http://archive.radiohead.com/Site13/s1.png'></span>
          </button>
        </li>
      </ul>
    </div>
  )
}

export default App;
